import React from "react";

//Calendar item
class CalendarItem extends React.Component{
    constructor(props){
        super(props);
    }
render(){
    return(
        <div>
            <label for ="NewItemSubject">Subject:</label>
            <input type="text" id="NewItemSubject"></input>            
            <input type="text" id="NewItemText"></input>
            <label for="NewItemTime">Time:</label>
            <input type="time" id ="NewItemTime"></input>
            <label for="NewItemDate">Time:</label>
            <input type="date" id ="NewItemDate"></input>
        </div>
    )
}

}
export default CalendarItem;
